  return (
    <div className="kesher">
      רוצים להיות ראשונים להתעדכן על הטבות? אפשרויות חדשות לעשות כסף? הכניסו את
      המייל שלכם ואנו נעדכן אתכם ראשונים. עמוד הבית הקורונה והסגר הפכו את העבודה
      מהבית לאופציה אטרקטיבית במיוחד עבור מאות אלפי ישראלים שיצאו לחל"ת, מחפשים
      עבודה ונמצאים בעיקר בבית. עבור כל מי שרוצה לייצר הכנסה בפיג'מה מהמיטה, זה
      הזמן להכיר את 'עבודה מהבית', האתר הגדול בישראל בתחום, שמציע אלפי עבודות
      ממגוון סוגים בתקופה בה אנחנו נמצאים הרבה בבית ומחפשים מקורות הכנסה, עבודה
      מהבית יכולה להיות פתרון מושלם, נוח וזמין. אתר 'עבודה מהבית' הוא האתר הגדול
      בישראל בתחום, עם אלפי הצעות עבודה מהבית במגוון עצום של ענפים. היום, במקום
      לחטט באתרי הדרושים השונים ולאתר את העבודות הנכונות עבורכם, 'עבודה מהבית'
      מרכזת את מיטב העבודות של המעסיקים המרכזיים במשק - באתר אחד. היתרון הגדול -
      לעבוד עם המחשב הנייד מהספה בסלון אם בימים רגילים עבודה מהבית י
      <input />
      <button>שלח</button>
    </div>
